import React from 'react';
import Story_blok from './Story_blok';

function Story() {
  return (
    <div>
      <Story_blok
        pro_pic='https://i.picsum.photos/id/1041/200/200.jpg?hmac=1CDPtzGhHDqltV1i3b5YV4hY9UYY_6ubvXbxJO9QchQ'
        story='https://i.picsum.photos/id/237/200/300.jpg?hmac=TmmQSbShHz9CdQm0NkEjx1Dyh_Y984R9LpNrpvH2D_U'
        name='Tomal'
      />
    </div>
  );
}

export default Story;
